        function assignButton(id, items, chartName){
                document.getElementById(id).addEventListener('click', () => {
                createChart(items, chartName)
            })
        }

        function fixDate(items) {
            for (const item of items){
                item.Time = new Date(item.Time)
            }
        }

        function createChart(items, chartName) {
            var canvas = document.getElementById("canvas")
            if (canvas)
            charts.createChart(canvas, items, {
                legend: {
                    chartName: chartName,
                    xTitle: 'Значение по оси Х: ',
                    yTitle: 'Значение по оси Y: ',
                    tooltip: {
                        onShow(e, i) {
                            const style = document.getElementById('chart2t').style
                            style.opacity = '1'
                            style.top = e.point.y
                            style.left = e.point.x 
                            document.getElementById('chart2x').innerText = i.xText
                            document.getElementById('chart2y').innerText = i.yText
                        },
                        onHide() {
                            const c = document.getElementById('chart2t')
                            if (!c) return
                            const style = c.style
                            style.opacity = '0'
                        }
                    }
                },
                thresholdOrientation: 'y',
                thresholds: [
                    // { value: 180, color: '#a26330' },
                    // { value: 140, color: 'rgba(192,160,10,.33)' },
                    // { minValue: 100000, maxValue: 177216713, color: '#fe1530' },
                     { minValue: 80, maxValue: 228, color: '#3e7510', showLimits: true },
                    // { minValue: 67, maxValue: 70, color: '#fe1530' },
                    // { minValue: 40, maxValue: 60, color: '#cec530' },
                    // { minValue: 20, maxValue: 40, color: '#3ec500' },
                    { minValue: 10,  maxValue: 36, color: '#1ea54c', showLimits: true },
                    { minValue: 1.5,  maxValue: 2.5, color: '#1ea54c', showLimits: true }
                ],
                xFieldName: 'Time',
                yFieldName: 'Value',
                xSegmentCount: 8,
                xFieldDisplayFormat: (v) => v.getHours() + ":" + v.getMinutes(), // moment(v).format('HH:mm'),
                xFieldToolTipFormat: (v) => moment(new Date(v)).format('HH:mm'),
                yFieldDisplayFormat: (v) => parseFloat(v).toFixed(0),
                yAxisValueFormat: (v) => parseFloat(v).toFixed(2),
                width: 640,
                height: 480
            })()
        }
